var list = [
            {"name": "Ghazna", "elo": 1568, "id": 1273899123, "active": true},
            {"name": "Ghazna", "elo": 1200, "id": 1273899123, "active": true},
            {"name": "Ghazna", "elo": 1100, "id": 1273899123, "active": true},
            {"name": "Ghazna", "elo": 2042, "id": 1273899123, "active": false},
            {"name": "Ghazna", "elo": 1023, "id": 1273899123, "active": false}];


class MemberList {
    constructor() {
        this.state = {members : list, count : list.length};
    }

    getTotalCount() {
        console.log(this.state.count);
        return this.state.count;
    }

}


export default MemberList;
